const vicePresidentInitiatives_namespaceObject = JSON.parse('{"mainTitle":"VICE PRESIDENT","subTitle":"OFFICE OF THE","initiatives":[{"id":"initiative_1","initiativeNum":"Initiative 1","title":"Student Assembly Archives","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FStudent%20Assembly%20Archives.jpeg?alt=media&token=e28df98e-be9b-4d26-99eb-82f36aec6143","contents":[{"type":"paragraph","contents":"The Student Assembly Archives serves as the official virtual library of the Student Assembly. It compiles all Student Assembly\'s publications and documents on their legislative procedures and activities made accessible to the public for recordkeeping and transparency purposes. It includes such but is not limited to enacted resolutions, policies, proposals, appointments, bills, journals, minutes, and others. Through the archives, the Student Assembly narrows the gap and makes the student body more involved in legislative affairs."},{"type":"hyperlink","link":"https://drive.google.com/drive/folders/1WlZnfqweut__sw4BqGV8PF0jJYdfFdAE","contents":"Click here to view the Archives"}]},{"id":"initiative_2","initiativeNum":"Initiative 2","title":"Ateneo Community Codes","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FAteneo%20Community%20Codes.jpeg?alt=media&token=a0cae921-f6b1-45ff-bbdd-2fd2694c2ceb","contents":[{"type":"paragraph","contents":"The Ateneo Community Codes (ACC) are written and recorded guidelines to better understand our specific sectors\' needs. They will serve as a code of ethics for people to follow to protect the stakeholders of the Codes. This also involves fathering concerned individuals who form that particular sector to draft the set of provisions for the Code (i.e., Moro student members or LGBTQ+ members). They shall have drafting and reading phases for the final approval. These community codes crafted through the OVP will be coordinated and proposed to the Office of the Student Affairs (OSA) to update the student handbook, which is one of the best avenues to protect the students of Ateneo."},{"type":"paragraph","contents":"The students will now be taught appropriately about other sectors, and we will be able to prevent or at least mitigate our mistakes that could have been avoided if we had been more aware of who they are and how they should be treated. As a sector, we can now effectively articulate our needs and wants. In genuinely putting students first through the ACC, protection will be institutionalized."}]},{"id":"initiative_3","initiativeNum":"Initiative 3","title":"Ateneo for Ateneans","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FAteneo%20for%20Ateneans.jpeg?alt=media&token=a723f8ef-8d3f-4822-ab11-e269129cad98","contents":[{"type":"paragraph","contents":"[Adaptation of School of Engineering and Architecture’s iRoar, Relief Operations mechanisms, Protocols, and AA Volunteers]"}]},{"id":"initiative_4","initiativeNum":"Initiative 4","title":"Isdaan","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FIsdaan.jpeg?alt=media&token=190e81cd-a15c-46ae-a12c-af6958496660","contents":[{"type":"paragraph","contents":"The Student Board: ISDAAN establishes a portal where all opportunities are available to the students, sanctioned by the university, or posted outside AdDU. Through this, opportunities will no longer be exclusive to some when accessing. Agencies and organizations can now have one place to gather applications and offerings. It aims to centralize applications and sources and outsource for a more efficient system for students of AdDU."}]},{"id":"initiative_5","initiativeNum":"Initiative 5","title":"SAMAHAN Speakers Bureau","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FSAMAHAN%20Speakers%20Bureau.jpg?alt=media&token=57011fdf-6bd5-420a-8944-086891d9ea6d","contents":[{"type":"paragraph","contents":"With Student Judicial Court officially operating this school year 2022-2023, the SAMAHAN Office of the Vice President would like to continue its quest to empower and amplify the voices of the students by complimenting the missing element of the Student Judicial Court. Akin to the lawyers and legal counsels to represent people in court, at Ateneo de Davao University, there is no such organization or arm to do so."},{"type":"paragraph","contents":"SAMAHAN Speakers Bureau becomes an avenue for ateneans to represent themselves to the Student Judicial Court. SSB becomes akin to the Free Legal Assistance Group (FLAG) or the Public Attorney’s Office (PAO)."}]},{"id":"initiative_6","initiativeNum":"Initiative 6","title":"The Ateneo Parliament 2022","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FVice-President%20Initiatives%2FThe%20Ateneo%20Parliament%202022.jpeg?alt=media&token=04c2d680-f45f-4e05-9cf8-13cad0fa1c7b","contents":[{"type":"paragraph","contents":"The Ateneo Parliament 2022 is a university-wide congress where 60 students will be given a chance for legislative capacity-building and forwarding their advocacies through resolution-making. It aims to #NarrowTheGap on the lack of opportunities for some Ateneans to develop and empower as sui generis leaders who could greatly contribute to serving the Ateneo community, the Mindanaons, and the whole nation."}]}]}');
