const secretaryGeneralInitiatives_namespaceObject = JSON.parse('{"mainTitle":"SECRETARY GENERAL","subTitle":"OFFICE OF THE","initiatives":[{"id":"initiative_1","initiativeNum":"Initiative 1","title":"SAMAHAN Pin: The Homecoming Initiative","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FSecretary%20General%20Initiatives%2FSAMAHAN%20Pin%20-%20The%20Homecoming%20Initiative.jpg?alt=media&token=44cd3e7a-8e53-4c92-8a29-5ce5e1a911a5","contents":[{"type":"paragraph","contents":"At the onset of the opening of the campus for the FLEX modality of blended learning (HISFlex), a campus pin landmark will welcome the students to serve as a pop-up SAMAHAN assistance booth. Physical copies of the SAMAHAN Safe Return to Campus kits will also be given to students upon request."}]},{"id":"initiative_2","initiativeNum":"Initiative 2","title":"WeCreate SAMAHAN","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FSecretary%20General%20Initiatives%2FWeCreate%20SAMAHAN.jpeg?alt=media&token=9d90e489-8534-4cac-bec9-deb7d5d47b74","contents":[{"type":"paragraph","contents":"Together, WeCreate SAMAHAN as we execute and concretize our collective goal to serve communities beyond Ateneo. This year, every Atenean is empowered to empower as you join us as dreamers and doers of your own passion projects. WeCreate SAMAHAN is a capacity-building camp that will help Sui Generis leaders craft their own initiatives para sa bayan!"}]},{"id":"initiative_3","initiativeNum":"Initiative 3","title":"The Paper Boat Project Year 2","imgBgSrc":"https://firebasestorage.googleapis.com/v0/b/samahan-website.appspot.com/o/Images%2FSecretary%20General%20Initiatives%2FThe%20Paper%20Boat%20Project%20Year%202.jpg?alt=media&token=a4639bfa-bbd1-411f-82df-0404213127f5","contents":[{"type":"paragraph","contents":"Funded by the Office of the Treasurer’s AdDU to Cart, this year, The Paper Boat Project will once again visit public schools and communities to share with our Mindanaoan children the power and beauty of reading. Through reading and storytelling, our goal is to expose them to limitless possibilities so they will fashion a vision of their own future."}]}]}');
;// CONCATENATED MODULE: ./src/data/aboutSecondSection.json
const aboutSecondSection_namespaceObject = JSON.parse('{"firstP":"This year, the Samahan ng mga Mag-aaral ng Pamantasang Ateneo de Davao is here for a lot of things — it is here for a more visible student representation, it is here for a closer university community, it is here for a humanized form of leadership that is both mission- and people-oriented, and it is here for you. It means building our pathways forward in allowing ourselves to take control of our shared direction by strengthening the culture of sui generis leadership that creates transformative change from our grassroot communities up to the global arena. It is here as a student government that is sensitive to the needs of its constituents and responsive to the emergent needs of a new world inside and outside the university.","secondP":"It has been three years since the COVID-19 pandemic took us through a drastic paradigm shift — challenging our capacity and ideals in building a vibrant university community. However, together with the lessons learned and the difficulties conquered, we take these experiences in stride in fueling our hope of transitioning back to the life we used to own — back to the people and the purposes that drive us in our collective pursuit for a student government that is here and now.","thirdP":"In the new world, let our leadership be known as one that takes up the challenge to respond to the signs of the times; let our leadership be present here and now. This is the SAMAHAN that we want to envision. This is the SAMAHAN that rises to the occasion."}');
